INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24015, 4, "カオリ（サマー）", 4, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 1, 24, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24016, 1, "カオリ（サマー）", 4, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 2, 24, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24017, 4, "カオリ（サマー）", 4, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 3, 24, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24018, 2, "カオリ（サマー）", 1, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 4, 24, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24019, 6, "カオリ（サマー）", 5, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 5, 24, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24020, 2, "カオリ（サマー）", 2, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 6, 24, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24021, 6, "カオリ（サマー）", 1, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 7, 24, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24022, 2, "カオリ（サマー）", 2, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 8, 24, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24023, 3, "カオリ（サマー）", 6, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 9, 24, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24024, 2, "カオリ（サマー）", 1, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 10, 24, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 110501, 24025, 2, "カオリ（サマー）", 2, 10021, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 11, 24, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
